import './SearchForm.css'

import React from "react";


function SearchForm() {
    return (
        <section className="searchform">
            <form className="searchform__main">
                <input className="searchform__input" placeholder="Фильм" type="text" />
                <button type="submit" className="searchform__button"></button>
            </form>
            <div className="searchform__addition">
                <input className="searchform__checkbox" data-index="0" id="short-films" type="checkbox" />
                <label className="searchform__label" htmlFor="short-movies"></label>
                <span className="search-form__text">Короткометражки</span>
            </div>

        </section>
    )
}

export default SearchForm;
